import Title from '../components/widgets/title';
import Licon from '../components/widgets/licon';

export default class Main extends Component {
    render() {
        return (
            <div class="center Glass-plate main">
                <Title title="SociaLod" align="bold h1" />
                <div class="right-bottom">
                    <Licon link="" align="margin" src='https://img.icons8.com/ios-filled/50/ffffff/linkedin-circled.png' />
                    <Licon link="" align="margin" src='https://img.icons8.com/ios-filled/50/ffffff/github.png' />
                    <Licon link="" align="margin" src='https://img.icons8.com/ios-filled/50/ffffff/circled-chevron-right.png' />
                </div>
            </div>
        );
    }
}
